import { Col, Row } from 'react-bootstrap';
import './FilterComponent.scss';
import { memo } from 'react';
function FilterComponent() {
  return (
    <Row>
      <Col md={9}>
        <div className="d-flex justify-content-between">
          <select className="input">
            <option value="">Client</option>
          </select>
          <select className="input">
            <option value="">Status</option>
          </select>
          <input className="input" placeholder="Chọn ngày" type="date" />
          <input className="input " placeholder="from" type="date" />
          <input className="input" placeholder="#Invoice" type="text" />
        </div>
      </Col>
      <Col md={3}>
        <div className="d-flex ">
          <button className="btn_filter">Apply</button>
          <button className="btn_filter">Clear</button>
        </div>
      </Col>
    </Row>
  );
}

export default memo(FilterComponent);
